import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  // central: {},
  // atlantic: {},
  // southeast: {},
  // southwest: {},
  // pacific: {},
  // northwest: {}

  return (
    <>
      <h3>Teams</h3>
      <div className="team-list">
        <div className="division-wrapper">
          {teams.map((team, i) => {
            if (team.division === "Central") {
              return (
                <Link to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>

        <div>
          {teams.map((team, i) => {
            if (team.division === "Atlantic") {
              return (
                <Link to={`/teams/${team.abbreviation}`}>
                  <p>{team.full_name}</p>
                </Link>
              );
            }
          })}
        </div>
        <div></div>
        <div></div>
        <div></div>
      </div>
    </>
  );
}
